import { useNavigate } from "react-router-dom";
import React, { Component } from "react";
import {
  ProductsContainer,
  ProductsWrapper,
  ProductsCard,
  ProductsIcon,
  ProductsH1,
  ProductsH2,
  ProductsP,
} from "./ProductElements";
import Icon1  from '../../common/assets/asset.svg';
import Icon2 from '../../common/assets/liability.svg'


function NewProduct() {
    const navigate = useNavigate();
    const data=[
      {"name":"asset","id":"1"},
      {"name":"liability","id":"2"}
    ]
    const handleClick = (event,param) => {
        navigate(`/createnewcontract/${param}`);
      };
  return (
    <>
      <ProductsContainer id="newproduct" style={{background: "#f9f9f9", display: "flow-npm root"}}>
        <ProductsH1 style={{color: "#010606"}}>Create New Smart Contract Product</ProductsH1>
        <ProductsWrapper style={{gridTemplateColumns: "1fr 1fr"}}>
          <ProductsCard onClick={(event) => handleClick(event,data[0].name)}>
            <ProductsIcon src={Icon1}/>
            <ProductsH2>Asset</ProductsH2>
            <ProductsP>Apply for credit at the comfort of your home.</ProductsP>
          </ProductsCard>
          <ProductsCard onClick={(event) => handleClick(event,data[1].name)}>
          <ProductsIcon src={Icon2}/>
            <ProductsH2>Liability</ProductsH2>
            <ProductsP>
              Access our platform online anywhere in the world.
            </ProductsP>
          </ProductsCard>
        </ProductsWrapper>
      </ProductsContainer>
    </>
  );
}

export default NewProduct;
